gmftool and gmfgraph models are very intolerant of editing/refactoring without major repairs to the subsequent gmfmap file. This is because e.g. ecore.gmfmap has a reference such as href="ecore.gmftool#//@palette/@tools.0/@tools.0"/.

If gmfgraph and gmftool were saved with xmi:ids the XMI serialisation of gmfgraph would use the xmi:ids and so tolerate many forms of manual edit. 

Suggestion: add a BasicResourceHandler instance whose preSave method assigns ids such as tool123 or graph89 via the XMLResource.OPTION_RESOURCE_HANDLER entry for XML save options.

If the following is useful, it's all my own work... It allocates new non-clashing prefixed numbers intially in the range 0 to 9, then 0 to 99 then
0 to 999, increasing the range by 10 each time 10 successive random guesses in the prior range have clashed.

	public static void assignIds(Resource resource, String xmiIdPrefix) {
		if (!(resource instanceof XMLResource))
			return;
		XMLResource xmlResource = (XMLResource) resource;
		if (xmiIdPrefix == null)
			xmiIdPrefix = "_";
		final Set<String> ids = new HashSet<String>(256);	// The Resource method is deprecated
									// and the replacement slow since we need a total traversal
		final List<EObject> idLess = new ArrayList<EObject>(100);
		for (TreeIterator iterator = xmlResource.getAllContents(); iterator.hasNext(); ) {
			Object object = iterator.next();
			if (object instanceof EObject) {
				EObject eObject = (EObject) object;
				String id = xmlResource.getID(eObject);
				if (id == null)
					idLess.add(eObject);
				else
					ids.add(id);
			}
		}
		int multiplier = 10;
		for (EObject eObject : idLess) {
			String id = null;
			while (id == null) {
				for (int tries = 0; tries < 10; tries++) {
					id = xmiIdPrefix + (int)(Math.random() * multiplier);
					if (!ids.contains(id)) {
						xmlResource.setID(eObject, id);
						ids.add(id);
						break;
					}
					else
						id = null;
				}
				if (id == null)
					multiplier *= 10;
			}
		}
	}

NB. An Ecore feature requires that if multiple models are to be saved then referenced models must have ids before referencing models are saved. So a per-save pre-save is not soon enough. It needs to be applied to the ResourceSet before the first save. Probably not a problem for gmftool/gmfgraph that are sole outputs.

