Updated SimpleDNDExample

Hi Jeff,

I modified your example slightly to fix the two problems that you mentioned.

1) The first problem can be fixed by preventing a drag from happenning when there are no selection. Although the behaviour between Linux and Windows are slightly different, the code below will work for both and will make the behaviour the same.
Prevent the drag from happening (in dragStart) if there's no selection
	public void dragStart(DragSourceEvent event) {
		Point selection = urlCombo.getSelection();
		String text = urlCombo.getText();
		if (selection == null || text == null || selection.x >= selection.y) {
			event.doit = false;
		}
	}

2) The second problem where you can't receive "drop" can be fixed by allowing the MOVE operation. Or press Ctrl to force a COPY.

	int operations = DND.DROP_COPY | DND.DROP_MOVE | DND.DROP_LINK;

I fixed your example and re-attached it here. Try it out and let me know if this solved your problems on Windows and Linux.

